function generateDefaultPDF() {
    var doc = new jsPDF();

    doc.text('Hello world!', 10, 10);
    doc.save('a4.pdf');
}

function carInvoicePDF(id) {
    var url = 'http://' + ip + ':' + port + '/detail/' + id;
    $.get(url, function(data) {
        var text = '';
        var space = '    | ';
        var separator = '\n\n\n---------------------------------\n';

        var userinfo =  '\n' + space + 'Name: ' + user.lastname + ', ' + user.firstname + '\n' +
                        '\n' + space + 'Billing Address: ' + user.address +
                        '\n' + space + 'Billing Zipcode: ' + user.postalcode +
                        '\n' + space + 'Billing Country: ' + user.country + '\n' +
                        '\n' + space + 'Shipping Address: ' + user.shipaddress +
                        '\n' + space + 'Shipping Zipcode: ' + user.shippostalcode +
                        '\n' + space + 'Shipping Country: ' + user.shipcountry + '\n\n' +
                        separator + '\n\n';

        text = text + userinfo;

        var carsarray = data[0].properties['cars'].toString().split(",");
        var cars = 'Cars: \n';
        for(i = 0; i < carsarray.length; i++) {
            cars = cars + '   - ' + carsarray[i].replace('&#8364;', '\u20AC ') + '\n';
        }
        text = text + cars + '\n';

        var caridarray = data[0].properties['carIDs'].toString().split(",");
        var ids = 'Car Unique Identifiers: \n';
        for(i = 0; i < caridarray.length; i++) {
            ids = ids + '   - ' + caridarray[i] + '\n';
        }
        text = text + ids + '\n';

        text = text + separator;
        text = text + 'Total Price: \u20AC ' + data[0].properties['price'] + '\n\n';

        generatePDF(text);
    });
}       // Generate a car invoice PDF based on the node id of the order

function nodePDF(id) {
    var url = 'http://' + ip + ':' + port + '/detail/' + id;
    $.get(url, function(data) {
        var text = '';
        for (var key in data[0].properties) {
            if (data[0].properties.hasOwnProperty(key)) {
                if (data[0].properties[key] != '' && data[0].properties[key] != '') {
                    text = text + key + ': ' + data[0].properties[key] + '\n\n';
                }
            }
        }

        generatePDF(text);
    });
}

function generatePDF(text) {                  // Generate a PDF based from the information in the database attached to this ID

    var doc = new jsPDF();
    var imageData = 'data:image/jpeg;base64,';

    // Logo
    doc.setFont('helvetica');
    doc.setFontType('bold');
    doc.setFontSize(50);
    doc.text(10, 10, '\n CarShop \n\n\n');
    doc.addImage(imageData, 'JPEG', 170, 10, 30, 30);

    // Text
    doc.setFont('helvetica');
    doc.setFontType('normal');
    doc.setFontSize(10);
    doc.text(20, 45, text);

    var string = doc.output('datauristring');

    var iframe = "<iframe width='100%' height='100%' src='" + string + "'></iframe>"

    $('#invoice').html(iframe);

    // data = doc.output 'dataurlstring', {}
    // $('#report').html "<iframe src='#{data}'></iframe>"
}
